                    <p class="text_p">I understand that to provide protection from serious financial loss, should an accident occur, my installment contract requires the vehicle to be continuously covered with insurance against the risks of fire, theft and collision. Accordingly, I have arranged for the required insurance through the insurance company shown below and have requested my agent to note the lien holder's interest in the vehicle and endorse the policy with a loss payable endorsement (NAUA Form 51b or equivalent) in favor of the lien holder at the address listed below.</p>
